import React, { useState } from "react";
import './main_page.css';
import plantImage from '../../images/1.png';


export const MainPage = () => {
    const [isExpanded, setIsExpanded] = useState(false);
    const shopCart = () => {
        setIsExpanded(!isExpanded);
        console.log("first");
    };
    const [isExpandedNew, setIsExpandedNew] = useState(false);
    const prodictSearch = () => {
        setIsExpanded(!isExpandedNew);
        console.log("second");
    };
    const [isExpandedNew1, setIsExpandedNew1] = useState(false);
    const Login = () => {
        setIsExpanded(!isExpandedNew1);
        console.log("third");
    };
    return(
        <div className="main_page">
            <button className="login_button" onClick={Login}>Log in</button>

            <div className="first_block">
                <p className="main_title">Houseplants store</p>
                <p className="descr_text">Demonstration of SQL injection and buffer overflow 
                    vulnerabilities in the context of an online houseplants  
                    store.</p>
                <div className="button_place">
                    <button className="first_button" onClick={shopCart}>Shopping cart</button>
                    <button className="second_button" onClick={prodictSearch}>Product search</button>
                </div>
            </div>
            <div className="second_block">
                <img 
                src={plantImage} 
                alt="Main plant imag"
                className="image_main" 
                />
            </div>
        </div>

    );
}
